  base: *id011
  body: "Commit c15f7747c78e (\"MAINT: remove a bunch of compiler warnings\")\r\n\
    broke compilation if HAVE_CEXPx is defined with no good reason.\r\n\r\nThe problem\
    \ is with defined HAVE_CEXPx _npy_scaled_cexp() is never\r\ndefined and compiler:\r\
    \n 1) Reports implicitly declared function\r\n 2) Uses default return type \"\
    int\" in equations like:\r\n      z = _npy_scaled_cexp@c@(absx, y, -1);\r\n  \
    \  where z is \"@ctype@\" which might very well differ from int...\r\n 3) ...\
    \ and finally throws an error, see:\r\n--------------------------->8------------------------\r\
    \nnumpy/core/src/npymath/npy_math_complex.c.src: In function 'npy_ccoshl':\r\n\
    numpy/core/src/npymath/npy_math_complex.c.src:643:17: warning: implicit declaration\
    \ of function '_npy_scaled_cexpl' [-Wimplicit-function-declaration]\r\n      \
    \       z = _npy_scaled_cexp@c@(absx, y, -1);\r\n                 ^~~~~~~~~~~~~~~~~\r\
    \nnumpy/core/src/npymath/npy_math_complex.c.src:643:15: error: incompatible types\
    \ when assigning to type 'npy_clongdouble {aka struct <anonymous>}' from type\
    \ 'int'\r\n             z = _npy_scaled_cexp@c@(absx, y, -1);\r\n--------------------------->8------------------------\r\
    \n               ^"
